export default function Warranty() {
  const data = [
    {
      item: "Motor System",
      parts: ["Linear Actuator", "Driving Motor"],
      warranty: "2 Years",
    },
    {
      item: "Power System",
      parts: ["Lithium-ion Battery", "Power Adapter", "Docking Station"],
      warranty: "2 Years",
    },
    {
      item: "Electric Control System",
      parts: ["RTK System", "Motherboard"],
      warranty: "2 Years",
    },
    {
      item: "Sensor",
      parts: ["Camera", "Millimeter-wave Radar"],
      warranty: "2 Years",
    },
    {
      item: "Consumables",
      parts: ["Shell", "Tracks", "Lubricants"],
      warranty: ["1 Year", "1 Year", "No Warranty"],
    },
  ];

  return (
    <div className="overflow-x-auto">
      <table className="w-full border-collapse border border-gray-300">
        <thead>
          <tr className="bg-black text-white">
            <th className="p-2 border">Item</th>
            <th className="p-2 border">Parts</th>
            <th className="p-2 border">Warranty Time</th>
          </tr>
        </thead>
        <tbody>
          {data.map((row, index) => (
            row.parts.map((part, partIndex) => (
              <tr key={`${index}-${partIndex}`} className={index % 2 === 0 ? "bg-gray-100" : ""}>
                {partIndex === 0 && (
                  <td rowSpan={row.parts.length} className="p-2 border font-semibold text-green-600">
                    {row.item}
                  </td>
                )}
                <td className="p-2 border text-green-600">{part}</td>
                <td className="p-2 border text-green-600">
                  {Array.isArray(row.warranty) ? row.warranty[partIndex] : row.warranty}
                </td>
              </tr>
            ))
          ))}
        </tbody>
      </table>
    </div>
  );
}
